import React from 'react';
import InputMask from 'react-input-mask'; 

const MaskedInput = (value: any, onChange: React.ChangeEventHandler<HTMLInputElement> | undefined)=>{
    return <InputMask mask="(99) 99999-9999" value={value} onChange={onChange}/>;
};
export default MaskedInput
